INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AGNCM', 'STOCK', 'AGNC Investment Corp.', 'NMS', 'Real Estate', 'REIT - Mortgage', 'AGNC Investment Corp. is an internally managed real estate investment trust (REIT). The Company provides private capital to the United States housing market, enhancing liquidity in the residential real estate mortgage markets and, in turn, facilitating home ownership in the United States. The Company invests primarily in Agency residential mortgage-backed securities (Agency RMBS) on a leveraged basis. These investments consist of residential mortgage pass-through securities and collateralized mortgage obligations for which the principal and interest payments are guaranteed by a United States Government-sponsored enterprise, such as the Federal National Mortgage Association (Fannie Mae) and the Federal Home Loan Mortgage Corporation (Freddie Mac, and together with Fannie Mae, the GSEs), or by a United States Government agency, such as the Government National Mortgage Association (Ginnie Mae). It may also invest in other assets related to the housing, mortgage or real estate markets.', 'Bethesda, MD, United States', 53);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DDT', 'STOCK', 'Dillards Capital Trust I CAP SECS 7.5%', 'NYQ', NULL, NULL, NULL, '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMBI', 'STOCK', 'Ambipar Emergency Response', 'ASE', 'Industrials', 'Waste Management', 'Ambipar Emergency Response is a Brazil-based holding company. The Company is primarily engaged in the environmental and emergency response services industry. The Company focuses on managing environmental risks and responding to emergencies involving hazardous materials, industrial accidents, and natural disasters. Their key product is Emergency Response Services, which is a comprehensive service offering that includes containment, mitigation, and remediation of environmental incidents. It aims to reduce environmental damage, protect human health, and ensure compliance with environmental regulations. The Company integrates technologies such as Geographic Information Systems (GIS) and Artificial Intelligence (AI) to support real-time monitoring, decision-making, and operational efficiency during emergency situations. These services are provided to clients across sectors including logistics, energy, chemicals, and manufacturing.', 'São Paulo, SP, Brazil', 7435);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CULP', 'STOCK', 'Culp, Inc.', 'NYQ', 'Consumer Cyclical', 'Textile Manufacturing', 'Culp, Inc. is a marketer of mattress fabric for bedding and upholstery fabrics for residential, commercial, and hospitality furniture in North America. The Company markets a variety of fabrics to its global customer base of bedding and furniture companies, including fabrics produced at the Companys manufacturing facilities and fabrics sourced through other supplies. Its segments include mattress fabrics and upholstery fabrics. The mattress fabrics segment, also known as Culp Home Fashions, manufactures and markets mattress fabrics and sewn mattress covers for bedding manufacturers. These products include woven jacquard fabrics, knitted fabrics, and some converted fabrics. The upholstery fabrics segment markets fabrics for residential, commercial, and hospitality furniture. This segment also includes window treatment products and installation services through its Read Window Products business, including roller shades, drapery, hardware, and top-of-mattress soft goods.', 'High Point, NC, United States', 829);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CFA', 'STOCK', 'VictoryShares US 500 Volatility Wtd ETF', 'NGM', NULL, NULL, 'The fund seeks to achieve its investment objective by investing, under normal market conditions, at least 80% of its assets directly or indirectly in the securities included in the Nasdaq Victory U.S. Large Cap 500 Volatility Weighted Index, an unmanaged, volatility weighted index maintained exclusively by the index provider. The index identifies the 500 largest U.S. stocks by market capitalization measured at the time the index''s constituent securities are determined.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AFGD', 'STOCK', 'American Financial Group, Inc.', 'NYQ', NULL, NULL, 'American Financial Group, Inc. is an insurance holding company. Through the operations of Great American Insurance Group, the Company is engaged primarily in property and casualty insurance, focusing on specialized commercial products for businesses. The Companys segments include property and casualty insurance and Other. The property and casualty insurance business includes specialty sub-segments: property and transportation, which includes physical damage and liability coverage for buses and trucks and other specialty transportation niches, inland and ocean marine, agricultural-related products and other commercial property coverage; specialty casualty, which includes primarily excess and surplus, executive and professional liability, general liability, umbrella and excess liability, and specialty financial, which includes risk management insurance programs for lending and leasing institutions, fidelity and surety products and trade credit insurance.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('TMB', 'STOCK', 'Thornburg Multi Sector Bond ETF', 'NGM', NULL, NULL, 'The fund pursues its investment objective by investing in a broad range of income-producing investments, primarily including debt obligations. The fund manager may invest in debt obligations of any kind, of any quality, and of any maturity. The fund is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ENO', 'STOCK', 'Entergy Utility Group, Inc. 1ST MTG BD 66', 'NYQ', NULL, NULL, 'Entergy New Orleans, LLC is an electric and gas utility company. The Company is engaged in the generation, transmission, distribution, and sale of electric power. The Company owns an 870 megawatt (mg) Michoud Plant generating station. Its Michoud Plant located in eastern New Orleans. The Company is also engaged in operating a natural gas distribution business.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ANL', 'STOCK', 'Adlai Nortye Ltd.', 'NGM', 'Healthcare', 'Biotechnology', 'Adlai Nortye Ltd. is a Cayman Islands-based investment holding company. The Company is involved in the research and development of pharmaceutical products. It is a clinical-stage company focused on the development of targeted and immune-modulating cancer therapies. It is advancing an oncology pipeline, with Buparlisib (AN2025), a pan-phosphoinositide 3-kinase (PI3K) inhibitor, being evaluated in a registrational Phase three trial (NCT04338399) for patients with recurrent or metastatic head and neck squamous cell cancer (HNSCC) that has progressed after prior anti-programmed death-ligand 1 (PD-L1) treatment. It is also advancing multiple drug candidates, including AN4005, an oral small molecule PD-L1 inhibitor; AN8025, a multifunctional fusion protein acting as a T cell and antigen-presenting cell (APC) modulator; and AN9025, an oral small molecule pan-rat sarcoma virus (RAS) inhibitor. The Companys subsidiary, Alpine Bioscience Ltd. (Alpine BVI), is an investment holding company.', 'Grand Cayman, , Cayman Islands', 123);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASBA', 'STOCK', 'ASBA', 'NYQ', NULL, NULL, 'Associated Banc-Corp is a bank holding company. The Company, through Associated Bank and various nonbanking subsidiaries, provides an array of banking and nonbanking products and services to individuals and businesses through 188 banking branches, serving more than 100 communities, primarily within its three-state branch footprint. The Corporate and Commercial Specialty segment serves a wide range of customers, including larger businesses, developers, not-for-profits, municipalities, and financial institutions by providing lending and deposit solutions as well as the support to deliver, fund, and manage such banking solutions. The Community, Consumer and Business segment serves individuals and businesses by providing lending and deposit solutions and a variety of investment, fiduciary, and retirement planning products and services. The Risk Management and Shared Services segment includes key shared operational functions and also includes residual revenue and expenses.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APED', 'STOCK', 'STKd 100% MSTR & 100% COIN ETF', 'NGM', NULL, NULL, 'The fund is an actively-managed ETF that seeks to achieve its investment objective by employing derivatives, namely swap agreements and/or listed options contracts, to gain long exposure to two underlying securities, MicroStrategy Incorporated d/b/a Strategy (“MSTR”) and Coinbase Global, Inc. (“COIN”) (MSTR and COIN, each an “Underlying Security,” and together the “Underlying Securities”). The fund is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('LGRO', 'STOCK', 'Level Four Large Cap Growth Active ETF', 'NGM', NULL, NULL, 'The fund invests primarily in equity securities of carefully selected, high-quality U.S. companies. The fund invests primarily in the domestic equity securities of companies selected by Level Four Capital Management, LLC for their growth potential within various market sectors.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACU', 'STOCK', 'Acme United Corporation', 'ASE', 'Consumer Defensive', 'Household & Personal Products', 'Acme United Corporation is a supplier of first aid and medical products and cutting technology to the school, home, office, hardware, sporting goods and industrial markets. The Company markets and sells under two main product categories: first aid and medical; and cutting and sharpening. The first aid and medical category offers first aid and safety products under brands such as, First Aid Only, PhysiciansCare, Pac-Kit, Spill Magic, First Aid Central, Med-Nap, Safety Made and Elite brands. The cutting and sharpening categories offer school, home and office products, under the Westcott brand, and hardware, industrial and sporting goods products under the Clauss and DMT brands. It operates in the United States (including Asian operations), Canada and Europe. The Company sells its products primarily to mass market and e-commerce retailers, industrial distributors, wholesale, contract and retail stationery distributors, office supply superstores, sporting goods stores, and hardware chains.', 'Shelton, CT, United States', 633);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATLO', 'STOCK', 'Ames National Corporation', 'NCM', 'Financial Services', 'Banks - Regional', 'Ames National Corp is a bank holding company. The Company owns 100% of the stock of six bank subsidiaries consisting of one national bank and five state-chartered banks: First National Bank, Ames, Iowa (FNB); State Bank & Trust Co., Nevada, Iowa (SBT); Boone Bank & Trust Co., Boone, Iowa (BBT); Reliance State Bank, Story City, Iowa (RSB); United Bank & Trust Co., Marshalltown, Iowa (UBT); and Iowa State Savings Bank, Creston, Iowa. The Banks lending activities consist primarily of short-term and medium-term commercial, multifamily and agricultural real estate loans, residential real estate loans, agricultural and business operating loans and lines of credit, equipment loans, vehicle loans, personal loans and lines of credit, home improvement loans and origination of mortgage loans for sale into the secondary market. The Bank also offers a variety of checking, savings and time deposits, cash management services, merchant credit card processing, and safe deposit boxes.', 'Ames, IA, United States', 262);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATLCP', 'STOCK', 'Atlanticus Holdings Corporation', 'NMS', 'Financial Services', 'Credit Services', 'Atlanticus Holdings Corporation is a financial technology company. The Company is focused on facilitating consumer credit through the use of financial technology and related services. The Credit as a Service (CaaS) segment includes its private-label credit and general-purpose credit cards, which, through its bank partners, provide financing solutions to consumers. The Auto Finance segment purchases and/or services loans secured by automobiles and provides other financing options to independent automotive dealers and automotive finance companies. Its private-label and general-purpose card products are originated by The Bank of Missouri and WebBank. Its bank partners originate these accounts through multiple channels, including retail and healthcare point-of-sale locations, direct mail solicitation, digital marketing and partnerships with third parties. The Company uses its technology and proprietary predictive analytics, lenders can make instant credit decisions.', 'Atlanta, GA, United States', 417);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FIVY', 'STOCK', 'YieldMax Dorsey Wright Hybrid 5 Income ETF', 'NGM', NULL, NULL, 'The index uses the Nasdaq Dorsey Wright Relative Strength Matrix methodology (the “Dorsey Wright methodology”) to select the securities included in the index. The fund manager will typically hold ten index constituents, investing 40% of its assets in the five underlying securities and 60% of its assets in the five YieldMax™ ETFs included in the index. The fund is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FDNI', 'STOCK', 'First Trust Dow Jones International Internet ETF', 'NGM', NULL, NULL, 'The fund will normally invest at least 90% of its net assets (including investment borrowings) in the common stocks and depositary receipts that comprise the index. The index is developed, maintained and sponsored by S&P Dow Jones Indices LLC. The index is designed to measure the performance of securities of non-U.S. issuers whose primary business focus is Internet-related. The fund is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABCS', 'STOCK', 'Alpha Blue Capital US Small-Mid Cap Dynamic ETF', 'NGM', NULL, NULL, 'Under normal circumstances, at least 80% of the fund’s net assets, plus borrowings for investment purposes, will be invested in a blend of domestic equity securities of small- and mid- capitalization companies and ETFs that provide broad exposure to domestic equity securities of small- and mid- capitalization companies. It is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EBON', 'STOCK', 'Ebang International Holdings Inc.', 'NMS', 'Technology', 'Computer Hardware', 'Ebang International Holdings Inc. is a global blockchain technology and fintech company. The Company principally engages in manufacturing and selling high-performance bitcoin mining machines and telecommunication products and provides financial technology services through independently developed fintech service platforms. The Company has application-specific integrated circuit (ASIC) chip design capability. The Company designs non-functional integrated circuits (IC) and ICs. It has technology for designing ASIC chips, channels for obtaining third-party wafer casting capabilities, and capabilities for producing blockchain products. It has two cryptocurrency exchange platforms and one cross-border payment and foreign exchange platform. The Company also provides telecommunication products and management and maintenance services. Its transmission network products include ETN5000, ETN200, ETN200-E, ETN204G, and EB-MSAP.', 'Hangzhou, , China', 218);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EDRY', 'STOCK', 'EuroDry Ltd.', 'NCM', 'Industrials', 'Marine Shipping', 'EuroDry Ltd is a Greece-based company which operates in the dry cargo, dry bulk shipping markets. The Company''s operations are managed by Eurobulk Ltd an affiliated ship management company and Eurobulk (Far East) Ltd. Inc, which are responsible for the day-to-day commercial and technical management and operations of the vessels. EuroDry Ltd employs its vessels on spot and period charters and through pool arrangements. The Company has a fleet of more than five vessels, including Kamsarmax drybulk carriers, Panamax drybulk carriers and an Ultramax drybulk carrier with a total cargo capacity of approximately 400,000 deadweight tonnage (dwt). The Company''s subsidiaries are: Kamsarmax One Shipping Ltd, Kamsarmax Two Shipping Ltd and Eirini Shipping Ltd, among others.', 'Marousi, , Greece', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CICB', 'STOCK', 'CION Investment Corporation', 'NYQ', '', '', 'CION Investment Corporation is an externally managed, non-diversified closed-end management investment company. The Company''s investment objective is to generate current income and, to a lesser extent, capital appreciation for investors. Its portfolio is comprised primarily of investments in senior secured debt, including first lien loans, second lien loans and unitranche loans, and, to a lesser extent, collateralized securities, structured products and other similar securities, unsecured debt, and equity, of private and thinly traded United States middle-market companies. The Company''s investment portfolio includes healthcare and pharmaceuticals, chemicals, plastics and rubber, high-tech industries, beverage, food and tobacco, capital equipment, banking, finance, insurance and real estate, aerospace and defense, construction and building, telecommunications, hotel, gaming, and leisure, automotive, and metals and mining. Its investment adviser is CION Investment Management, LLC.', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COE', 'STOCK', '51Talk Online Education Group', 'ASE', 'Consumer Defensive', 'Education & Training Services', '51Talk Online Education Group operates an online education platform with core expertise in English education. The Company''s online and mobile education platforms enable students to take live interactive English lessons, on demand. The Company connects its students with a large pool of teachers that it assembled using a shared economy approach and employs student and teacher feedback and data analytics to deliver a personalized learning experience to its students. It provides English course offerings in Hong Kong, Malaysia, and certain other countries and regions. It mainly conducts one-on-one online live English courses taught by teachers from the countries and regions outside mainland China, targeting children aged five to 12.', 'Singapore, , Singapore', 360);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNFR', 'STOCK', 'Conifer Holdings, Inc.', 'NCM', 'Financial Services', 'Insurance - Property & Casualty', 'Conifer Holdings, Inc. is an insurance holding company. It is engaged in the sale of property and casualty insurance products. It markets and services its product offerings through specialty commercial and specialty personal insurance business lines. Its personal insurance lines offer homeowners insurance and dwelling fire insurance products to individuals in several states. The specialty homeowners insurance product line is primarily comprised of low-value dwelling insurance tailored for owners of lower-valued homes, which it offer in Illinois, Indiana, and Texas. Its commercial insurance offers coverage for both commercial property and commercial liability, including commercial automobiles and workers compensation. Its insurance policies are sold to targeted small and mid-sized businesses on a single or multiple-coverage basis.', 'Troy, MI, United States', 9);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSBK', 'STOCK', 'Bogota Financial Corp.', 'NCM', 'Financial Services', 'Banks - Regional', 'Bogota Financial Corp. is a bank holding company of Bogota Savings Bank (the Bank). The Bank generally originates residential, commercial and consumer loans to, and accepts deposits from, customers in New Jersey. The Bank attracts deposits from the public and municipalities and uses those funds along with advances from the Federal Home Loan Bank of New York and funds generated from operations to originate one- to-four-family residential real estate loans and commercial real estate and multifamily loans and, to a lesser extent, consumer loans, commercial and industrial loans and construction loans. It also invests in securities, which consist primarily of United States government and agency obligations, municipal obligations, corporate bonds, and mortgage-backed securities. It operates seven offices located in Bogota, Hasbrouck Heights, Upper Saddle River, Newark, Oak Ridge, Parsippany and Teaneck, New Jersey and a loan production office in Spring Lake, New Jersey.', 'Teaneck, NJ, United States', 62);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ECCX', 'STOCK', 'Eagle Point Credit Company Inc. 6.6875% NT 28', 'NYQ', NULL, NULL, 'Eagle Point Credit Company Inc. is an externally managed, non-diversified closed-end management investment company. The Companys primary investment objective is to generate high current income, with a secondary objective to generate capital appreciation. The Company seeks to achieve its investment objectives by investing primarily in equity and junior debt tranches of collateralized loan obligations (CLOs) that are collateralized by a portfolio consisting primarily of below investment grade United States senior secured loans with a large number of distinct underlying borrowers across various industry sectors. The Company invests in various industries, including technology: software and services, media; hotels, restaurants and leisure; health care providers and services; diversified financial services; commercial services and supplies; diversified telecommunication services; professional services; insurance, and chemicals.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DVOL', 'STOCK', 'First Trust Dorsey Wright Momentum & Low Volatility ETF', 'NGM', NULL, NULL, 'Under normal conditions, the fund will invest at least 90% of its net assets (including investment borrowings) in the equity securities that comprise the index. The index is a rules-based equity index designed to track the overall performance of the 50 stocks comprising the NASDAQ U.S. Large Mid Cap Index TM that exhibit the lowest levels of volatility while still maintaining high levels of "relative strength."', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CFSB', 'STOCK', 'CFSB Bancorp, Inc.', 'NCM', 'Financial Services', 'Banks - Regional', 'CFSB Bancorp, Inc. is the holding company for Colonial Federal Savings Bank and is the majority owned subsidiary of 15 Beach, MHC. Colonial Federal Savings Bank (the Bank) is a federally chartered stock savings bank that has served the banking needs of its customers on the south shore of Massachusetts. The Bank provides a variety of financial services to individuals and small businesses through its offices in Quincy, Holbrook, and Weymouth. Its primary deposit products are savings, checking and term certificate accounts, and its primary lending products are one- to four-family residential mortgages, multifamily real estate loans, commercial real estate loans, second mortgage loans, home equity lines of credit and consumer loans. It operates from three full-service offices and one limited-service office in Quincy, Holbrook and Weymouth, Massachusetts.', 'Quincy, MA, United States', 27);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ELTK', 'STOCK', 'Eltek Ltd.', 'NCM', 'Technology', 'Electronic Components', 'Eltek Ltd. manufactures, markets and sells custom made printed circuit boards (PCBs), including high density interconnect (HDI), flex-rigid and rigid, with high layer count boards. The Company manufactures and supplies custom made circuitry solutions for use in compact electronic products. The Company''s principal customers include manufacturers of defense and aerospace, medical, industrial, telecom and networking equipment, as well as contract electronic manufacturers. The Company designs and develops manufacturing solutions pursuant to interconnect requirements of original equipment manufacturers, and provides its customers with a range of custom designed PCBs, including rigid, double-sided and multi-layer PCBs, as well as flexible circuitry (flex and flex-rigid boards) made of various types of base material. The Company also acts as an agent for the importation of PCBs from South East Asia. The Company provides fabrication of dense multi-layer PCBs.', 'Petah Tikva, , Israel', 329);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARMP', 'STOCK', 'Armata Pharmaceuticals, Inc.', 'ASE', 'Healthcare', 'Biotechnology', 'Armata Pharmaceuticals, Inc. is a clinical-stage biotechnology company focused on the development of pathogen-specific bacteriophage therapeutics for the treatment of antibiotic-resistant and difficult-to-treat bacterial infections using its bacteriophage-based technology. The Company is developing and advancing a broad pipeline of natural and synthetic phage candidates, including clinical candidates for Pseudomonas aeruginosa, Staphylococcus aureus, and other pathogens. It is advancing two lead candidates, such as AP-PA02 and AP-SA02, to address both chronic and acute bacterial infections. Its lead phage candidate, inhaled AP-PA02, is focused primarily on the treatment of chronic pulmonary infections due to Pseudomonas aeruginosa. In parallel, it has an acute bacterial infection clinical development plan focused on Staphylococcus aureus bacteremia, a difficult-to-treat and often life-threatening infection.', 'Los Angeles, CA, United States', 60);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCTG', 'STOCK', 'CCSC Technology International Holdings Limited', 'NCM', 'Industrials', 'Electrical Equipment & Parts', 'CCSC Technology International Holdings Ltd is an investment holding company engaged in the sale, design and manufacturing of interconnect products. The Companys interconnect products include connectors, cables and wire harnesses used for industrial, automotive, robotics, medical equipment, computer, network and telecommunication and consumer products. The Company is engaged in the production of both OEM and ODM interconnect products for manufacturing companies.', 'Sha Tin, , Hong Kong', 264);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BEPI', 'STOCK', 'Brookfield BRP Holdings (Canada', 'NYQ', NULL, NULL, NULL, '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATLCL', 'STOCK', 'Atlanticus Holdings Corporation 6.125% Senior Notes due 2026', 'NGM', NULL, NULL, 'Atlanticus Holdings Corporation is a financial technology company. The Company is focused on facilitating consumer credit through the use of financial technology and related services. The Credit as a Service (CaaS) segment includes its private-label credit and general-purpose credit cards, which, through its bank partners, provide financing solutions to consumers. The Auto Finance segment purchases and/or services loans secured by automobiles and provides other financing options to independent automotive dealers and automotive finance companies. Its private-label and general-purpose card products are originated by The Bank of Missouri and WebBank. Its bank partners originate these accounts through multiple channels, including retail and healthcare point-of-sale locations, direct mail solicitation, digital marketing and partnerships with third parties. The Company uses its technology and proprietary predictive analytics, lenders can make instant credit decisions.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BCML', 'STOCK', 'BayCom Corp', 'NMS', 'Financial Services', 'Banks - Regional', 'BayCom Corp is a bank holding company. The Company, through its wholly owned operating subsidiary, United Business Bank, offers a full range of loans, including Small Business Administration (SBA), California Pollution Control Financing Authority (CalCAP), FSA and USDA guaranteed loans, and deposit products and services to businesses and their affiliates in California, Washington, New Mexico, Colorado and Nevada. It offers a full range of lending products, including commercial and multifamily real estate loans (including owner-occupied and investor real estate loans), commercial and industrial loans, SBA loans, construction and land loans, agriculture-related loans and consumer loans. It also offers consumer loans, predominantly as accommodation to its commercial clients, which include installment loans, unsecured and secured personal lines of credit, and overdraft protection. The Company has a network of approximately 35 full-service branches.', 'Walnut Creek, CA, United States', 331);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BBH', 'STOCK', 'VanEck Biotech ETF', 'NGM', NULL, NULL, 'The fund normally invests at least 80% of its total assets in securities that comprise the fund''s benchmark index. The Biotech Index includes common stocks and depositary receipts of U.S. exchange-listed companies in the biotechnology industry. Such companies may include medium-capitalization companies and foreign companies that are listed on a U.S. exchange. It is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DVAL', 'STOCK', 'BrandywineGLOBAL Dynamic U.S. Large Cap Value ETF', 'NGM', NULL, NULL, 'The fund will only invest in U.S. traded companies, which may include companies incorporated outside the U.S. which conduct a significant portion of their activities in the U.S. and are considered U.S. companies in the Russell U.S. indices. In addition, under normal market conditions, the fund invests at least 80% of its net assets in equity securities of large capitalization companies or other instruments with similar economic characteristics. The fund may have significant positions in particular sectors from time to time.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FDSB', 'STOCK', 'Fifth District Bancorp, Inc.', 'NCM', 'Financial Services', 'Banks - Regional', 'Fifth District Bancorp, Inc. is the holding company for Fifth District Savings Bank (the Bank), a federally chartered stock savings bank. The Bank attracts deposits from the general public and uses such deposits primarily to originate loans secured by first mortgages on owner-occupied, family residences. It offers a variety of savings account options, such as Fifth Savings, Money Market, Certificates of Deposit, Christmas Club, Individual Retirement Account (Traditional/Education/ROTH), and Health Savings Accounts. It also provides various business savings account options, such as Business Elite Checking, Business Plus Checking, Business Basic Checking, Business Savings, Business Money Market, and others. It provides various loans, such as mortgage loans, construction loans, vacant lot loans, and home equity line of credit. The Bank also provides various services, including debit cards, credit cards, telephone banking, overdraft privilege, and wire transfer services.', 'New Orleans, LA, United States', 67);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EEIQ', 'STOCK', 'EpicQuest Education Group International Limited', 'NCM', 'Consumer Defensive', 'Education & Training Services', 'EpicQuest Education Group International Limited is a holding company. The Company provides comprehensive education solutions for domestic and international students seeking university and college degrees in the United States, Canada, and the United Kingdom. It owns and operates EduGlobal University, based in British Columbia, Canada, which focuses on English proficiency educational programming for students pursuing academic degrees. It operates and is a 70% owner of Davis University, a career training University located in Toledo, Ohio. In addition, it has a recruiting relationship with the Miami University Regional campuses, where it maintains residential facilities, a full-service cafeteria, recreational facilities, shuttle buses and an office for the regional campuses that provides study abroad and post-study services for its students. It is also a recruiting agent for the University of the West of Scotland (through The Education Group (London) Ltd) and Coventry University.', 'Middletown, OH, United States', 43);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMBO', 'STOCK', 'Ambow Education Holding Ltd.', 'ASE', 'Consumer Defensive', 'Education & Training Services', 'Ambow Education Holding Ltd. is an artificial intelligence (AI)-driven technology company offering phygital (physical + digital) solutions for education, corporate conferencing and live events. Designed for the education, corporate conferencing and live events industries, HybriU enables organizations to deliver real-time content and engagement across in-person and remote audiences. The Company''s platform combines AI automation, immersive video, data analytics and easy-to-deploy hardware in a plug-and-play solution that adapts to a range of settings, from university lecture halls to global business meetings and large-scale conferences. The platform generates sales posters and short videos to promote the auto-generated online content. In parallel with its technology operations, it also owns and operates the NewSchool of Architecture & Design in San Diego. The institution offers accredited undergraduate and graduate degree programs in architecture and design.', 'Cupertino, CA, United States', 6);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ESCA', 'STOCK', 'Escalade, Incorporated', 'NGM', 'Consumer Cyclical', 'Leisure', 'Escalade, Incorporated designs, manufactures, and sells sporting goods, fitness, and indoor/outdoor recreation equipment. The Company operates through one business segment: Sporting Goods (Escalade Sports). Escalade Sports manufactures, imports, and distributes sporting goods brands in basketball goals, archery, indoor and outdoor game recreation and fitness products through sporting goods retailers, specialty dealers, key online retailers, direct-to-consumer e-commerce, traditional department stores and mass merchants. Its archery brands include Bear Archery, Trophy Ridge, Whisker Biscuit, Cajun Bowfishing, Karnage, SIK and BearX. Its table tennis brands include STIGA and Ping-Pong. Its basketball brands include Goalrilla, Goalsetter, Goaliath, Silverback and Hoopstar. Its billiard tables and accessories brands include American Heritage Billiards, Brunswick Billiards, Cue&Cas, Lucasi and others. Its outdoor games brands include Victory Tailgate, Triumph, Zume Games and ACL.', 'Evansville, IN, United States', 450);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CANC', 'STOCK', 'Tema Oncology ETF', 'NGM', NULL, NULL, 'Under normal circumstances, the fund seeks to achieve its investment objective by investing at least 80% of its net assets, which include borrowings for investment purposes, in publicly listed companies that derive at least 50% of revenues from oncology. The fund is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EFSI', 'STOCK', 'Eagle Financial Services, Inc.', 'NCM', 'Financial Services', 'Banks - Regional', 'Eagle Financial Services, Inc. is a bank holding company of Bank of Clarke (the Bank). The Bank offers a range of commercial banking, retail banking and trust and investment services through its approximately 13 full-service branches, two loan production offices, one wealth management office and one drive-through only facility located throughout Clarke and Frederick Counties, as well as the City of Winchester, towns of Purcellville and Leesburg and Ashburn, Virginia. The Bank offers a range of retail and commercial banking services, including demand, savings and time deposits and consumer, mortgage and commercial loans. The Bank has approximately 13 ATM locations in its trade area and issues debit cards to deposit customers. The Bank offers telephone banking, Internet banking, and mobile banking to its customers. The Bank of Clarke Wealth Management Division, a division of the Bank, provides both a full-service trust department and a separate brokerage area.', 'Berryville, VA, United States', 245);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BPRN', 'STOCK', 'Princeton Bancorp, Inc.', 'NMS', 'Financial Services', 'Banks - Regional', 'Princeton Bancorp, Inc. is the holding company for The Bank of Princeton (the Bank). The Bank is a New Jersey state-chartered commercial bank. The Bank operates over 28 branches in New Jersey; five branches in the Philadelphia, Pennsylvania area and two in the New York City metropolitan area. The Bank is a full-service bank providing personal and business lending and deposit services. The Bank offers traditional retail banking services, one-to-four-family residential mortgage loans, multi-family and commercial mortgage loans, construction loans, commercial business loans and consumer loans. Its loan portfolio consists of variable-rate and fixed-rate loans with a significant concentration on commercial real estate lending. Its commercial real estate and multi-family loan portfolio consists primarily of loans secured by small office buildings, strip shopping centers, small apartment buildings and other properties used for commercial and multi-family purposes located in its market area.', 'Princeton, NJ, United States', 247);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('OCCIN', 'STOCK', 'OFS Credit Company, Inc.', 'NCM', 'Financial Services', 'Asset Management', 'OFS Credit Company, Inc. is a non-diversified, closed-end management investment company. The Company''s primary investment objective is to generate current income, with a secondary objective to generate capital appreciation. The Company seeks to invest approximately 80% of its assets, or net assets plus borrowings, in floating rate credit-based instruments and other structured credit investments, including collateralized loan obligation (CLO) debt and subordinated, which includes residual or equity securities traditional corporate credit investments, including leveraged loans and high yield bonds; opportunistic credit investments, including stressed and distressed credit situations and long/short credit investments, and other credit-related instruments. The CLOs in which it invests are collateralized by portfolios consisting primarily of below investment grade United States senior secured loans. The investment adviser of the Company is OFS Capital Management, LLC.', 'Chicago, IL, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BCLO', 'STOCK', 'iShares BBB-B CLO Active ETF', 'NGM', NULL, NULL, 'The fund seeks to achieve its investment objective by investing, under normal circumstances, at least 80% of its net assets, plus the amount of borrowings for investment purposes, in CLOs that are, at the time of purchase, rated from BBB+ to B-. The fund is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COWS', 'STOCK', 'Amplify Cash Flow Dividend Leaders ETF', 'NGM', NULL, NULL, 'The fund invests at least 80% of its net assets in securities that comprise the index, which will primarily include dividend paying U.S. equity securities. The index is based on a proprietary methodology developed and maintained by Kelly Indexes, LLC, an affiliate of Kelly Strategic Management, LLC, an investment sub-adviser to the fund. The fund is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CZFS', 'STOCK', 'Citizens Financial Services, Inc.', 'NCM', 'Financial Services', 'Banks - Regional', 'Citizens Financial Services, Inc. is the holding company for First Citizens Community Bank (the Bank). The Bank is a full-service bank engaged in a range of banking activities and services for individual, business, governmental and institutional customers. These activities and services principally include checking, savings, and time deposit accounts; residential, commercial and agricultural real estate, commercial and industrial, state and political subdivision and consumer loans; and a variety of other specialized financial services. The Bank also provides trust services, including the administration of trusts and estates, retirement plans, and other employee benefit plans, along with a brokerage division that provides a comprehensive menu of investment services. It is primarily engaged in the ownership and management of CZFS Acquisition Company, LLC, its subsidiary, the Bank, and the Banks'' wholly owned subsidiaries, First Citizens Insurance Agency, Inc. and 1st Realty of PA LLC.', 'Mansfield, PA, United States', 380);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLST', 'STOCK', 'Catalyst Bancorp, Inc.', 'NCM', 'Financial Services', 'Banks - Regional', 'Catalyst Bancorp, Inc. is a bank holding company for Catalyst Bank (the Bank). The Bank is a federally chartered community-oriented savings bank. The Bank is primarily engaged in attracting deposits from the general public and using those funds to invest in loans and securities. The Banks principal sources of funds are customer deposits, repayments of loans, maturities of investments and funds borrowed from outside sources, such as the Federal Home Loan Bank (FHLB) of Dallas or the Federal Reserve Bank of Atlanta. These funds are primarily used for the origination of loans, including single-family residential first mortgage loans, commercial real estate mortgage loans, multi-family residential mortgage loans, commercial and industrial loans, construction and land loans and other loans. The Bank offers commercial and retail banking products through its six full-service branches located in Carencro, Eunice, Lafayette, Opelousas, and Port Barre.', 'Opelousas, LA, United States', 49);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FEUZ', 'STOCK', 'First Trust Eurozone AlphaDEX ETF', 'NGM', NULL, NULL, 'The fund will normally invest at least 90% of its net assets (including investment borrowings) in the securities that comprise the index. The index is designed to select stocks from the NASDAQ Eurozone Index that may generate positive alpha, or risk-adjusted returns, relative to traditional passive-style indices through the use of the AlphaDEX® selection methodology.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EIIA', 'STOCK', 'Eagle Point Institutional Income Fund', 'NYQ', 'Financial Services', 'Asset Management', NULL, 'Greenwich, CT, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADXN', 'STOCK', 'Addex Therapeutics Ltd', 'NCM', 'Healthcare', 'Biotechnology', 'Addex Therapeutics Ltd is a Switzerland-based clinical-stage pharmaceutical company. The Company focuses on development and commercialization of orally available small molecule drugs known as allosteric modulators for neurological disorders. The Companys clinical programs pipeline include dipraglurant (mGlu5 NAM), which is Phase 2a placebo-controlled clinical trial for Parkinson''s disease levodopa-induced dyskinesia (PD-LID), and is being prepared to enter registration trials for PD-LID, and ADX71149 (mGlu2 positive allosteric modulator or PAM), which is being developed in collaboration by its partner Janssen Pharmaceuticals, Inc to treat schizophrenia and anxious depression. It also is advancing several preclinical programs, including GABABPAM for pain, overactive bladder and other disorders, mGlu7 NAM for post-traumatic stress disorder, mGlu2 NAM for mild neurocognitive disorders, mGlu4 PAM for Parkinsons disease and mGlu3 PAM for neurodegenerative disorders.', 'Geneva, , Switzerland', 2);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ECBK', 'STOCK', 'ECB Bancorp, Inc.', 'NCM', 'Financial Services', 'Banks - Regional', 'ECB Bancorp, Inc. is a bank holding company for Everett Co-operative Bank (the Bank). The Bank''s business consists primarily of taking deposits from the general public and investing those deposits, together with funds generated from operations, in one-to-four family residential real estate loans, commercial real estate and multifamily real estate loans, construction and land loans and home equity lines of credit and loans. It also invests in securities, consisting primarily of United States government and federal agency obligations, mortgage-backed securities and corporate bonds. It offers a variety of deposit accounts, including certificates of deposit accounts, IRAs, money market accounts, savings accounts and both interest-bearing and noninterest-bearing checking accounts. It considers its deposit market area to be Middlesex, Essex and Suffolk Counties, Massachusetts and, its primary lending area to be these counties, as well as Norfolk County, Massachusetts.', 'Everett, MA, United States', 64);\n
